    AHset_extra (yy_user_defined, &dummy_yyguts);

    if (ptr_yy_globals == NULL){
        errno = EINVAL;
        return 1;
    }
	
    *ptr_yy_globals = (yyscan_t) AHalloc ( sizeof( struct yyguts_t ), &dummy_yyguts );
	
